@J_u_l_i_e___ @Actu_Transilien @RERB Bonjour, pour ce qui est des trains de la ligne K, je laisse mes collègues du Transilien vous renseigner.
La page [LIEN] peut aussi vous être utile.
À votre service.

@marinesdiary Bonjour, ce train a bien été supprimé aujourd'hui.
Vous trouverez un justificatif sur l'appli Mon Assistant SNCF en entrant vos gares de départ et d'arrivée ainsi que l'heure d'arrivée prévue à Paris (12h30).
Je reste à votre service pour toute précision.

@j0rdibar0 Bonsoir,
Je fais remonter ;)
Bonne soirée !

@youpala Bonjour Lucie,
Merci pour ce signalement. Nous notons votre remarque et la faisons suivre auprès des équipes concernées.
Bonne journée.

@GuillaumeMalard @ville_albi Bonjour Guillaume,
Nous n'avons pas d'informations concernant ce type d'abri vélo. Cependant, nous prenons note de votre remarque et la faisons suivre auprès des équipes concernées. 
Bonne journée.

@VirgileDelplace Bonsoir Virgile, non, ce n'est pas votre TER qui est en panne.
Le retard annoncé pour celui-ci est la conséquence de la panne d'un train de marchandises survenue à Ebblinghem, entre Hazebrouck et Saint-Omer.
Je reste à votre disposition pour toute précision.

@aOrtizBodiou @SNCF @GroupeSNCF Bonjour Alexandre,
Je comprends bien le désagrément. L'horaire disponible sur les sites de réservation est 12h41 alors qu'en effet, il est mentionné à 12h43 sur la fiche horaire. Je vais faire remonter cette incohérence. 
Quelle est votre destination svp ?
